import React from 'react';
import { Container, Row, Col, Card } from 'react-bootstrap';
import './GameCard.css'

const GameCard = () => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={10} lg={6} className="mt-4">
          <Card className="gameCard">
            <h5>Past Rolls</h5>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default GameCard;
